import React, { useEffect, useState } from "react";
import Card from "./Card";
import "@fortawesome/fontawesome-free/css/all.min.css";

const Newsapp = () => {
  const [state, setState] = useState("light-mode");

  const change = () => {
    if (state === "light-mode") {
      setState("dark-mode");
    } else {
      setState("light-mode");
    }
  };

  useEffect(() => {
    document.querySelector("body").className = state;
  }, [state]);

  const [search, setSearch] = useState("india");
  const [newsData, setNewsData] = useState(null);
  const API_KEY = "9c3ed8ee95884dec979460a60f96675b";

  const getData = async () => {
    const response = await fetch(
      `https://newsapi.org/v2/everything?q=${search}&apiKey=${API_KEY}`
    );
    const jsonData = await response.json();
    setNewsData(jsonData.articles.slice(0, 10));
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      {/* Bootstrap Navbar */}
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container-fluid">
          <a
            className="navbar-brand text-white"
            href="#"
            onClick={() => window.location.reload()}
          >
            NewsBook
          </a>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarSupportedContent"
            aria-controls="navbarSupportedContent"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <a className="nav-link text-white active" href="#">
                  Home
                </a>
              </li>
              <li className="nav-item">
                <a className="nav-link text-white" href="#">
                  Trending
                </a>
              </li>
              <li className="nav-item dropdown">
                <a
                  className="nav-link dropdown-toggle text-white"
                  href="#"
                  role="button"
                  data-bs-toggle="dropdown"
                  aria-expanded="false"
                >
                  Categories
                </a>
                <ul className="dropdown-menu bg-dark">
                  <li>
                    <button
                      className="dropdown-item text-white"
                      onClick={() => setSearch("sports")}
                    >
                      Sports
                    </button>
                  </li>
                  <li>
                    <button
                      className="dropdown-item text-white"
                      onClick={() => setSearch("politics")}
                    >
                      Politics
                    </button>
                  </li>
                  <li>
                    <button
                      className="dropdown-item text-white"
                      onClick={() => setSearch("entertainment")}
                    >
                      Entertainment
                    </button>
                  </li>
                  <li>
                    <button
                      className="dropdown-item text-white"
                      onClick={() => setSearch("health")}
                    >
                      Health
                    </button>
                  </li>
                </ul>
              </li>
            </ul>

            {/* Search Bar & Moon Icon */}
            <div className="d-flex align-items-center">
              <form className="d-flex me-3" role="search">
                <input
                  className="form-control me-3 bg-dark text-white border-light"
                  type="search"
                  placeholder="Search News"
                  value={search}
                  onChange={(e) => setSearch(e.target.value)}
                />
                <button
                  className="btn btn-outline-light"
                  type="button"
                  onClick={getData}
                >
                  Search
                </button>
              </form>
              <div className="icon" onClick={change}>
                <i className="fa-solid fa-moon fs-4 text-white"></i>
              </div>
            </div>
          </div>
        </div>
      </nav>

      {/* News Section */}
      <div>{newsData ? <Card data={newsData} /> : <p>Loading news...</p>}</div>
    </div>
  );
};

export default Newsapp;
